;(function($, window, document, undefined) {
    var methods = {
        init: function(options) {
            return this.each(function() {
                var $this = $(this);
                var $this = $(this),
                    opt = $this.data('tooltip');
                if (typeof(opt) == 'undefined') {
                    var defaults = {
                        eventType: 'click',
                        effect: 'hide', //
                        beforeShow: function() {}, //
                        afterHide: function() {} //
                    };
                    opt = $.extend({}, defaults, options);
                    $this.data('tooltip', opt);
                }
                opt = $.extend({}, opt, options);
                // $(window).bind('resize.tooltip'
                //     methods.reposition);
            });
        },
        destroy: function() {
            return this.each(
                function() {
                    $(window).unbind('.tooltip');
                });
        },
        reposition: function() {},
        show: function() {
            this.style.display = 'block';
        },
        hide: function() {
            this.style.display = 'none';
        },
        update: function(content) {},
        menu: function() {}
    };
    $.fn.tooltip = function(method) {
        if (methods[method]) {
            return methods[method].apply(this, Array.prototype.slice.call(arguments, 1));
        } else if (typeof method === 'object' || !method) {
            return methods.init.apply(this, arguments);
        } else {
            $.error('Method ' + method + ' does not exist on jQuery.tooltip');
        }
    };
})(jQuery);
$(function() {
    //
    window.onload = function(){
    }
        if (!(/msie [6|7|8|9]/i.test(navigator.userAgent))) {
            new WOW().init();
        };
    $('.navli').click(function() {
        var self = $(this);
        var navchild = self.find('.barLlist')
        if (!navchild) {
            return false;
        } else {
            self.find('.barLlist').toggle();
            $(this).siblings().find('.barLlist').hide();
        }
    });
    $('.gamesItem').bind('click' ,function(){
        $('#navGame').toggleClass('gamesList');
        $(".gamesMenu").addClass('active');
        });

    $("#navGame").click(function(e){
        if(e.target==this){
            $(this).hide();
        }
    })
})

